import React, { Component } from 'react';

class Jeu extends Component {
    render() {
        return (
            <div>
                <button>Piocher une carte</button>
                <button>Changer tour</button>
                <button>Attaquer</button>
            </div>
        );
    }
}

export default Jeu;
